import React from "react";

const List = ({people}) => {
  return (
    <div>
    {people.map((person) => {
    const {name, age, image, id} = person;
    return (
      <article className="person">
      <img src={image} alt="" />
      <div>
        <h4>{name}</h4>
        <p>{age}</p>
      </div>
    </article>
    )
    })}
    </div>
  )
}

export default List;
